    false,nt"url": null,nt"notes": "Oceanographic station, meteorological,
    and other data were collected from bottle casts from NOAA Ship ALBATROSS IV and
    other platforms from 22 October 1978 to 21 December 1980. Data were collected by
    the National Marine Fisheries Service (NMFS) and other institutions as part of the
    Marine Resources Monitoring, Assessment and Prediction (MARMAP) project. Data were
    processed by NODC to the NODC standard Oceanographic Station Data (SD2) format.
    Full format description is available from NODC at www.nodc.noaa.gov/General/NODC-Archive/sd2.html.nnThe
    Oceanographic Station Data format contains physical-chemical oceanographic data
    recorded at discrete depth levels. Most of the observations were made using multi-bottle
    Nansen casts or other types of water samplers. A small amount (about 5 percent)
    were obtained using electronic CTD conductivity-temperature-depth) or STD (salinity-temperature-depth)
    recorders. The CTD/STD data were reported to NODC at depth levels equivalent to
    Nansen cast data, however, and have been processed and stored the same as the Nansen
    data. Cruise information (e.g., ship, country, institution), position, date, and
    time, and reported for each station. The principal measured parameters and temperature
    and salinity, but dissolved oxygen, phosphate, total phosphorus, silicate, nitrate,
    nitrite, and pH may be reported. Meteorological conditions at the time of the cast
    (e.g., air temperature and pressure, wind, waves) may also be reported, as well
    as auxiliary data such as water color (Forel-Ule scale), water transparency (Secchi
    disk depth), and depth to bottom. Values of density (sigma-t), sound velocity, and
    dynamic depth anomaly are computed from measured parameters. Each station contains
    the measurements taken at the observed depth levels, but also includes data values
    interpolated to a set of standard depth levels.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
